    data: |
      SELECT DISTINCT - col1 + + 78 + + 20 * col2, col2 * - col2 AS col1 FROM tab0 (FORMAT parquet) WHERE + col1 / - 12 IS NOT NULL;
  - name: tab0

outputs:
  - name: q11331.out
    data: |
      2057	-9801
      257	-100
      937	-2209
